import React, { useState } from 'react';
import axios from 'axios';

function App() {

    const [data, setData] = useState(null);
    const word = documenint.getElementById("word");
    const onClick = () => {
      axios({
        method:"POST",
        data:{
          "word": word.value
      }
         .get('/translator/test')
        }).then((response) => {setData(response.data)
        }).catch(error=>{
          console.log(error);
          throw new Error(error);
      });
    };
    return (
      <div>
        <div>
          <button onClick={onClick}>불러오기</button>
        </div>

        {data && (
        <textarea
        rows={7}
        value={data.message.result.translatedText}
        readOnly={true}
        />
        )}
      </div>
    );
}

export default App;
